import { useState, useEffect } from 'react';
import axios from 'axios';
import { Link } from 'react-router-dom'

function Navbar() {
  const [items, setItems] = useState([]);
  const [name, setName] = useState('');
  const [description, setDescription] = useState('');
  const [price, setPrice] = useState('');

  useEffect(() => {
    axios.get('http://127.0.0.1:5000/api/items')
      .then(response => setItems(response.data))
      .catch(error => console.log(error));
  }, []);

  const handleSubmit = (event) => {
    event.preventDefault();
    const data = {
      name: name,
      description: description,
      price: price
    };
    axios.post('http://127.0.0.1:5000/api/items', data)
      .then(response => {
        setItems([...items, response.data]);
        setName('');
        setDescription('');
        setPrice('');
      })
      .catch(error => console.log(error));
  }
  return (
    <>
    <nav className="navbar navbar-expand-lg bg-body-tertiary">
  <div className="container-fluid">
    <Link className="navbar-brand fs-1" to="/">Sofian<span className='fs-5 text-warning me-5'>.shop</span></Link>
    <button className="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation">
      <span className="navbar-toggler-icon"></span>
    </button>
    <div className="collapse navbar-collapse" id="navbarSupportedContent">
      <ul className="navbar-nav me-auto mb-2 mb-lg-0">
        <li className="nav-item"><Link className="nav-link active fs-5 fw-light me-5" to="/"    >Home   </Link></li>
        <li className="nav-item"><Link className="nav-link active fs-5 fw-light me-5" to="Men"  >Men    </Link></li>
        <li className="nav-item"><Link className="nav-link active fs-5 fw-light me-0" to='Women'>Women  </Link></li>
      </ul>
      <form className="d-flex" role="search">
        <input className="form-control me-2" type="search" placeholder="Search" aria-label="Search"/>
        <button className="btn btn-outline-success" type="submit">Search</button>
        <div>
      <form onSubmit={handleSubmit}>
        <label>
          Name:
          <input type="text" value={name} onChange={event => setName(event.target.value)} />
        </label>
        <br />
        <label>
          Description:
          <input type="text" value={description} onChange={event => setDescription(event.target.value)} />
        </label>
        <br />
        <label>
          Price:
          <input type="text" value={price} onChange={event => setPrice(event.target.value)} />
        </label>
        <br />
        <button type="submit">Create Item</button>
      </form>
      <ul>
        {items.map(item => (
          <li key={item.id}>
            <h3>{item.name}</h3>
            <p>{item.description}</p>
            <p>{item.price}</p>
          </li>
        ))}
      </ul>
    </div>
      </form>
    </div>
  </div>
</nav>
    </>
  )
}

export default Navbar
